"use strict";import FormulaProcessor from"../FormulaProcessor.js";function MEDIAN(args,table){const median=[],values=FormulaProcessor.getArgumentsValues(args,table);for(let i=0,iEnd=values.length,value;i<iEnd;++i){value=values[i];switch(typeof value){case"number":if(!isNaN(value)){median.push(value)}break;case"object":for(let j=0,jEnd=value.length,value2;j<jEnd;++j){value2=value[j];if(typeof value2==="number"&&!isNaN(value2)){median.push(value2)}}break}}const count=median.length;if(!count){return NaN}const half=Math.floor(count/2);return count%2?median[half]:(median[half-1]+median[half])/2}FormulaProcessor.registerProcessorFunction("MEDIAN",MEDIAN);export default MEDIAN;